                heading: "Coding Competitions Farewell Rounds",
                body: 'Please carefully read the <a href="/terms">Coding Competitions Terms</a> ("Terms"), Google\'s general <a href="http://www.google.com/intl/en/policies/privacy/" target="_blank">Privacy Policy</a>, and these Rules for Coding Competitions Farewell Rounds (described below and referred to as the "CC Farewell Rounds Rules"), all of which together form a binding legal agreement between you and Google LLC with respect to the Coding Competitions Farewell Round Contest (the "CC Farewell Round Contest").',
