                                        title: "Submission Requirements.",
                                        body: "For each problem, you must submit the source code for your solution through the CC Farewell Round Contest website. You must indicate the programming language by using the provided dropdown menu. Your source code must be a single file that is able to run, as is, on our servers. The size of your source code may not exceed 100KB.\n"
